import React from 'react'
import success from '../../images/success-img.jpg';


const FormSuccess = () => {
    return (
        <div className='Form form-content-right'>
            <div className='form-success'>We have recieved your request</div>
            <img src={success} alt='' className='form-img-2'/>
        </div>
    )
}

export default FormSuccess
